graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="center"><font point-size="12"><b>E-Commerce Application</b></font></td></tr></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "Home" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Home</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Homepage</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "Complete" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Complete</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Order Complete</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "LoginPage" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>LoginPage</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "ShoppingCart" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>ShoppingCart</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "Checkout" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Checkout</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];

  // Edges
  "Home" -> "LoginPage" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "LoginPage" -> "ShoppingCart" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "ShoppingCart" -> "Checkout" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "Checkout" -> "Complete" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
}
